import './App.css';
import Header from "./components/Header/Header";
import AddTodo from "./components/AddTodo/AddTodo";
import TodoItem from "./components/TodoList/TodoItem";


function App(props) {
    return (
        <div className="App">
                <Header/>
                <AddTodo/>
                <TodoItem/>
        </div>
    );
}

export default App;
